import React from 'react';

const About = () => {
    return (
        <React.Fragment>
            <h1>About</h1>
            <p>This is the ToDoList App v1.0.0 from a React Crash Course</p>
            <p>Right now it grabs 10 dummy ToDos from a json file, but you can add your own.</p>
        </React.Fragment>
    );
}
const ParaStyle = {
    padding: '10px'
}

export default About;
